import React, { useState, useContext, useEffect } from 'react';
import { AccountContext } from '../Accounts'
import { Link, useNavigate } from "react-router-dom"
import logo from "./ucmlogo.png"
import Login from '../Login';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
export const Header = () =>{



    return (

        <div className="head"> 
        <Container>
        <Navbar bg="dark" variant="dark" expand="lg" >
        <Container>
          <Navbar.Brand href="#home" className="justify-content-center"> 
            <a className="justify-content-center" href="#">
            <img src={logo} width="50" height="50" alt=""/>
             Lamine Geordan Sunga Kouangue
            </a>
          </Navbar.Brand>
          <Nav className="justify-content-end">
            <Nav.Link href="#home">About Me</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Others</Nav.Link>
          </Nav>
        </Container>
        </Navbar>
        </Container>




        </div>



    )


}





export const AdminMenu = () =>{

    const navigate = useNavigate()
    const { getSession, logout } = useContext(AccountContext);


    const signOut = (e) =>{
        e.preventDefault()
        logout();
        navigate('/')
        window.location.reload();
    }

    return (



    <div className="head">
      <Container>
        <Navbar bg="ligth" variant="ligth" expand="lg" >
        <Container>
          <Navbar.Brand href="#home" className="justify-content-center"> 
            <a className="justify-content-center" href="#">
            <img src={logo} width="50" height="50" alt=""/>
             Lamine Geordan Sunga Kouangue
            </a>
          </Navbar.Brand>
          <Nav className="justify-content-end">
            <Nav.Link href="#home">About Me</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Others</Nav.Link>
          </Nav>
        </Container>
        </Navbar>
        </Container>
    </div>
    )


}
